var EnhancedEcommerce={AddImpression(e,a,t){gtag("event","view_item",{items:[{id:e,name:a,variant:t}]})},AddProduct(e,a,t,i,r,n,c=1){gtag("event","add_to_cart",{items:[{id:e,name:a,category:i,brand:r,variant:t,price:n,quantity:c}]})},Purchase(e,a,t,i){gtag("event","purchase",{transaction_id:e,affiliation:"Webapp Order",value:a,currency:"VND",shipping:t,items:i})},PurchaseTest(e,a,t,i){dataLayer("event","purchase",{transaction_id:e,affiliation:"Webapp Order test",value:a,currency:"VND",shipping:t,items:i})}};